import React, { useState } from 'react';
import {
  Container,
  Typography,
  Box,
  Button,
  CircularProgress,
  Alert,
} from '@mui/material';
import { CloudUpload as CloudUploadIcon, FileCopy as FileCopyIcon } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom'; // For navigation
import { uploadFile } from '../api/fileApi'; // File API
import Header from '../components/Header';
import CryptoJS from 'crypto-js';
import UploadedFilesPage from './pages/UploadedFilesPage';
import AccessFilesPage from './pages/AccessFilesPage';

const HomePage = () => {
  const [file, setFile] = useState(null);
  const [uploading, setUploading] = useState(false);
  const [success, setSuccess] = useState(false);
  const [error, setError] = useState('');
  const [encryptedFile, setEncryptedFile] = useState(null);

  const navigate = useNavigate(); // Initialize navigation
  const AES_KEY = CryptoJS.lib.WordArray.random(32).toString(CryptoJS.enc.Hex);
  const AES_IV = CryptoJS.lib.WordArray.random(16).toString(CryptoJS.enc.Hex);

  const handleFileChange = (e) => {
    const selectedFile = e.target.files[0];
    setFile(selectedFile);
    setSuccess(false);
    setError('');

    if (selectedFile) {
      const reader = new FileReader();
      reader.onload = () => {
        const fileContent = reader.result;
        try {
          const encrypted = CryptoJS.AES.encrypt(fileContent, AES_KEY, {
            iv: AES_IV,
          }).toString();
          setEncryptedFile(new Blob([encrypted], { type: 'text/plain' }));
        } catch (err) {
          setError('Failed to encrypt the file.');
        }
      };
      reader.readAsText(selectedFile);
    }
  };

  const handleUpload = async () => {
    if (!encryptedFile) {
      setError('Please select a file before uploading.');
      return;
    }

    setUploading(true);
    setSuccess(false);
    setError('');

    try {
      await uploadFile(encryptedFile, AES_KEY, AES_IV);
      setSuccess(true);
    } catch (err) {
      setError('Failed to upload the encrypted file.');
    } finally {
      setUploading(false);
    }
  };

  return (
    <>
      <Header />
      <Container maxWidth="md" sx={{ mt: 10, textAlign: 'center' }}>
        <Typography variant="h4" gutterBottom>
          Secure File Upload
        </Typography>
        <Typography variant="body1" color="textSecondary" gutterBottom>
          Your files will be encrypted with AES-256 before uploading for enhanced security.
        </Typography>

        <Box
          sx={{
            mt: 4,
            p: 3,
            border: '1px dashed #ddd',
            borderRadius: 4,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            gap: 2,
            bgcolor: '#f9f9f9',
          }}
        >
          <Button
            variant="contained"
            component="label"
            startIcon={<CloudUploadIcon />}
            sx={{
              bgcolor: '#1976d2',
              '&:hover': {
                bgcolor: '#125ea8',
              },
            }}
          >
            Select File
            <input type="file" hidden onChange={handleFileChange} />
          </Button>
          {file && <Typography variant="body2">{file.name}</Typography>}
          <Button
            variant="contained"
            onClick={handleUpload}
            disabled={uploading || !file}
            sx={{
              mt: 2,
              bgcolor: '#4caf50',
              '&:hover': {
                bgcolor: '#388e3c',
              },
            }}
          >
            {uploading ? 'Uploading...' : 'Upload File'}
          </Button>
          {uploading && <CircularProgress size={24} sx={{ mt: 2 }} />}
        </Box>

        {success && (
          <Alert severity="success" sx={{ mt: 4 }}>
            File uploaded successfully and securely!
          </Alert>
        )}
        {error && (
          <Alert severity="error" sx={{ mt: 4 }}>
            {error}
          </Alert>
        )}

        {/* New Buttons */}
        <Box sx={{ mt: 4, display: 'flex', justifyContent: 'center', gap: 2 }}>
          <Button
            variant="outlined"
            startIcon={<FileCopyIcon />}
            onClick={() => navigate('/uploaded-files')}
          >
            View Uploaded Files
          </Button>
          <Button
            variant="outlined"
            startIcon={<FileCopyIcon />}
            onClick={() => navigate('/current-access-files')}
          >
            View Current Access Files
          </Button>
        </Box>
      </Container>
    </>
  );
};

export default HomePage;
